insert  into productcategories(productCategory,textDescription,htmlDescription,image) values 
('クラシックカー','車好きの方へ。あなたの夢のような車所有の夢を実現させましょう。クラシックなマッスルカー、夢のスポーツカー、映画にインスパイアされたミニチュアをお探しの方は、このカテゴリーで素晴らしい選択肢を見つけることができるでしょう。これらのレプリカは、細部と職人技に優れた注意を特色にし、そのような作業ステアリングシステム、開口部前方コンパートメント、取り外し可能なスペアホイールと開口部リアトランク、4輪独立したスプリングサスペンションなどの機能を提供しています。模型のサイズは1:10から1:24まであり、限定車や生産終了車も多数収録されています。すべてのモデルにはメーカーの鑑定書が付属しており、完全に組み立てられた状態でご家庭やオフィスに展示することができます。',NULL,NULL),
('オートバイ','当社のオートバイは、ハーレーダビッドソン、ドゥカティ、ベスパなどの伝説的なオートバイだけでなく、古典的なオートバイの最先端のレプリカです。モデルには、公式ロゴ、回転ホイール、可動式キックスタンド、フロントサスペンション、ギアシフトレバー、フットブレーキレバー、ドライブチェーンなど、驚くほどのディテールが盛り込まれています。使用されている素材は、ダイキャストとプラスチックを含みます。モデルのサイズは1:10から1:50までで、多数の限定版や生産終了の車両も含まれています。すべてのモデルは完全に組み立てられており、自宅やオフィスに飾ることができます。ほとんどのモデルには真正性の証明書が含まれています。',NULL,NULL),
('飛行機','ユニークなダイキャスト製の飛行機とヘリコプターのレプリカは、コレクションだけでなく、自宅やオフィス、教室の装飾にも適しています。モデルには、公式ロゴや記章、回転するジェットエンジンやプロペラ、格納式の車輪など、驚くほどのディテールが盛り込まれています。ほとんどのモデルは完全に組み立てられており、メーカーからの信頼性の証明書が付いています。',NULL,NULL),
('船','役員、顧客、友人、家族のための完璧な休日や記念日のギフト。これらの手作りの模型船は、何世代にもわたって大切にされるユニークで見事な芸術作品です。それらは十分に組み立てられ、家かオフィスの表示のために準備ができて来ます。私達は最高の質および最もよい価値を保証します。',NULL,NULL),
('鉄道列車','鉄道模型は、あらゆる年齢層の愛好家にとってやりがいのある趣味です。あなたが収集可能な木製の列車、電気路面電車や機関車を探しているかどうかにかかわらず、このカテゴリ内の任意の予算のための素晴らしい選択肢の数を見つけることができます。列車のインタラクティブな側面は、小さな子供に最適です。木製の列車セットは、5歳以下の子供に最適です。',NULL,NULL),
('トラック・バス','トラックとバスのモデルは、1920年代初頭から現在までに生産されたバスや特殊トラックをリアルに再現したものです。モデルのサイズは1:12から1:50までで、多数の限定版といくつかの生産中止車両が含まれています。素材はブリキ、ダイキャスト、プラスチックなどが使用されています。すべてのモデルにはメーカーからの鑑定書が付属しており、家庭やオフィスの装飾品としても最適です。',NULL,NULL),
('ビンテージカー','1900年代初頭から1940年代までに生産された自動車をリアルに再現したビンテージカーモデルです。素材はベークライト、ダイキャスト、プラスチック、木材を使用しています。レプリカのほとんどは1:18と1:24のスケールサイズで、ディテールと精度の最適化を実現しています。価格は$30.00からいくつかの特別な限定版のレプリカのための$180.00までの範囲です。すべてのモデルには、メーカーからの真正性の証明書が含まれており、完全に組み立てられた状態で、ご自宅やオフィスに飾る準備ができています。',NULL,NULL)
insert  into products(productCode,productName,productCategory,productScale,productVendor,productDescription,quantityInStock,buyPrice,MSRP) values 
('S10_1678','1969 Harley Davidson Ultimate Chopper','オートバイ','1:10','ミン リン ダイキャスト社','このレプリカは、動作するキックスタンド、フロントサスペンション、ギアシフトレバー、フットブレーキレバー、ドライブチェーン、ホイール、ステアリングを備えています。すべての部品は、その正確なスケールのために特に繊細であり、特別なケアと注意が必要です。',7933,'4881.63','9570.52'),
('S10_1949','1952 Alpine Renault 1300','クラシックカー','1:10','クラシック マテリアル クリエーションズ社','回転可能な前輪、ステアリング機能、精密な内装、精密エンジン、開閉可能なボンネット、開閉可能なトランク、開閉可能なドア、精密なシャーシ',7305,'9858.40','21430.12'),
('S10_2016','1996 Moto Guzzi 1100i','オートバイ','1:10','ハイウェイ 66 ミニ クラッシックス社','Moto Guzzi の公式ロゴと記章、モーターサイクルの側面に配置されたサドルバッグ、詳細なエンジン、ステアリング、サスペンション、2つのレザーシート、ラゲッジラック、デュアルエキゾーストパイプ、ハンドルバーに配置された小さなサドルバッグ、クロームアクセント付きツートンカラー塗装、優れたダイキャストディテール、回転ホイール、キックスタンド、プラスチックパーツとベークドエナメル仕上げのダイキャストメタル。',6625,'6899.81','11894.76'),
('S10_4698','2003 Harley-Davidson Eagle Drag Bike','オートバイ','1:10','レッド スター ダイキャスト社','モデルの特徴、ハーレーダビッドソンのオフィシャルロゴと記章、着脱式リアウィリーバー、樹脂パーツを使用した重厚なダイキャストメタル、本格的なマルチカラータンポプリントグラフィック、セパレートエンジンドライブベルト、フリーターンフロントフォーク、回転タイヤとリアレーシングスリック、鑑定書、精密なエンジン、ディスプレイスタンド、精密ダイキャストレプリカ、ベークドエナメル仕上げ、1:10スケールモデル、V型2気筒エンジンの優れたディテールを展示するための取り外し可能なフェンダー、シート、タンクカバーのピース。',5582,'9102.84','19366.48'),
('S10_4757','1972 Alfa Romeo GTA','クラシックカー','1:10','モーター シティ アート クラッシックス社','特徴は以下の通りです。回転可能な前輪、ステアリング機能、精密なインテリア、精密なエンジン、オープンフード、オープントランク、オープンドア、精密なシャーシ。',3252,'8568.50','13600.82'),
('S10_4962','1962 LanciaA Delta 16V','クラシックカー','1:10','セコンド ギア ダイキャスト社','特徴は以下の通りです。回転可能な前輪、ステアリング機能、精密なインテリア、精密なエンジン、オープンフード、オープントランク、オープンドア、精密なシャーシ。',6791,'10342.24','14774.56'),
('S12_1099','1968 Ford Mustang','クラシックカー','1:12','オートアート スタジオ デザイン社','ボンネット、ドア、トランクのすべてを開くと、細部にまでこだわったインテリアを見ることができます。ステアリングホイールは実際に前輪を回転させます。カラーはダークグリーン。',68,'9534.16','19457.39'),
('S12_1108','2001 Ferrari Enzo','クラシックカー','1:12','セコンド ギア ダイキャスト社','回転可能な前輪、ステアリング機能、精密な内装、精密エンジン、開閉可能なボンネット、開閉可能なトランク、開閉可能なドア、精密なシャーシ。',3619,'9559.41','20780.62'),
('S12_1666','1958 Setra Bus','トラック・バス','1:12','ウェリィー ダイキャスト プロダクションズ社','モデルの特徴は、30個の窓、天窓＆防眩ガラス、ワーキングステアリングシステム、オリジナルのロゴ。',1579,'7790.72','13667.49'),
('S12_2823','2002 Suzuki XREO','オートバイ','1:12','ユニマックス アート ギャラリーズ社','公式ロゴと記章、モーターサイクルの側面に配置されたサドルバッグ、詳細なエンジン、ステアリング、サスペンション、2つのレザーシート、ラゲッジラック、デュアルエキゾーストパイプ、ハンドルバーに配置された小さなサドルバッグ、クロームアクセントのツートーンペイント、優れたダイキャストディテール、回転ホイール、キックスタンド、プラスチックパーツとベークドエナメル仕上げのダイキャストメタル。',9997,'6627.09','15062.44'),
('S12_3148','1969 Corvair Monza','クラシックカー','1:18','ウェリィー ダイキャスト プロダクションズ社','1:18スケールのダイキャストで、開閉可能なボンネット、開閉可能なトランク、約10インチの長さの開閉可能なドア回転可能な車輪。',6906,'8914.96','15108.90'),
('S12_3380','1968 Dodge Charger','クラシックカー','1:12','ウェリィー ダイキャスト プロダクションズ社','1968年式ダッジチャージャーの1:12スケールモデル。ボンネット、ドア、トランクをすべて開くと、細部にまでこだわったインテリアが見えてきます。ステアリングホイールは実際に前輪を回転させます。カラーは黒。',9123,'7516.98','11744.26'),
('S12_3891','1969 Ford Falcon','クラシックカー','1:12','セコンド ギア ダイキャスト社','回転可能な前輪、ステアリング機能、精密な内装、精密エンジン、開閉可能なボンネット、開閉可能なトランク、開閉可能なドア、精密なシャーシ。',1049,'8305.87','17302.84'),
('S12_3990','1970 Plymouth Hemi Cuda','クラシックカー','1:12','スタジオ M アート モデルズ社','非常に詳細な1970年プリマス・クーダの1:12スケールモデル。クダは、1970年代のオリジナルマッスルカーの中でも最も速い車の一つとして一般的に受け入れられています。このモデルは1970年に製造されたオリジナル652台のうちの1台を再現したものです。カラーはレッド。',5663,'3192.74','7980.62'),
('S12_4473','1957 Chevy Pickup','トラック・バス','1:12','エクソト デザインズ社','1:12スケールダイキャスト、約50cmのフードが開き、ゴム製の車輪が付いています。',6125,'5570.52','11850.32'),
('S12_4675','1969 Dodge Charger','クラシックカー','1:12','ウェリィー ダイキャスト プロダクションズ社','1969年式ダッジチャージャーの詳細モデル。内外装を細かく再現したモデルです。赤と白で塗装されています。',7323,'5873.55','11516.98'),
('S18_1097','1940 Ford Pickup Truck','トラック・バス','1:18','スタジオ M アート モデルズ社','このモデルは、ソフトラバータイヤ、ワーキングステアリング、ラバーマッドガード、本物のフォードロゴ、精密な足回り、オープンドアとボンネット、取り外し可能なスプリットリアゲート、ベッドにマウントされたフルサイズのスペア、オープングローブボックスを備えた詳細なインテリアを特徴としています。',2613,'5833.15','11667.49'),
