USE classicmodels;

SET CHARACTER_SET_CLIENT = utf8;
SET CHARACTER_SET_CONNECTION = utf8;

/* Table No. 1 */
/* Table structure for table employees */
DROP TABLE IF EXISTS employees;

CREATE TABLE employees (
  employeeNumber int(11) NOT NULL comment '従業員番号',
  firstName varchar(50) NOT NULL comment '姓',
  lastName varchar(50) NOT NULL comment '名',
  firstNameKana varchar(50) NOT NULL comment '姓カナ',
  lastNameKana varchar(50) NOT NULL comment '名カナ',
  age int(11) NOT NULL comment '年齢',
  email varchar(100) NOT NULL comment 'メールアドレス',
  officeCode varchar(10) NOT NULL comment '営業所コード',
  reportsTo int(11) DEFAULT NULL comment '報告先',
  jobPosition varchar(50) NOT NULL comment '役職',
  PRIMARY KEY (employeeNumber),
  KEY reportsTo (reportsTo),
  KEY officeCode (officeCode)
) ENGINE=InnoDB 
DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci
comment='従業員'
;

/* Data for the table employees */
;

/* Table No. 2 */
/*Table structure for table offices */
DROP TABLE IF EXISTS offices;

CREATE TABLE offices (
  officeCode varchar(10) NOT NULL comment '営業所コード',
  postalCode varchar(15) NOT NULL comment '郵便番号',
  prefecture varchar(50) NOT NULL comment '拠点県',
  city varchar(50) NOT NULL comment '拠点都市',
  addressLine1 varchar(50) NOT NULL comment '住所1',
  addressLine2 varchar(50) DEFAULT NULL comment '住所2',
  phone varchar(50) NOT NULL comment '電話番号',
  area varchar(50) NOT NULL comment '地域',
  PRIMARY KEY (officeCode)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci
comment='営業所'
;

/*Data for the table offices */
;

/* Table No. 3 */
/*Table structure for table orderdetails */
DROP TABLE IF EXISTS orderdetails;

CREATE TABLE orderdetails (
  orderNumber int(11) NOT NULL comment '注文番号',
  productCode varchar(15) NOT NULL comment '商品コード',
  quantityOrdered int(11) NOT NULL comment '注文数量',
  priceEach decimal(10,2) NOT NULL comment '商品単価',
  orderLineNumber smallint(6) NOT NULL comment '注文説明番号',
  PRIMARY KEY (orderNumber,productCode),
  KEY productCode (productCode)
) ENGINE=InnoDB 
DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci
comment='注文明細'
;

/*Data for the table orderdetails */
;

/* Table No. 4 */
/*Table structure for table orders */
DROP TABLE IF EXISTS orders;

CREATE TABLE orders (
  orderNumber int(11) NOT NULL comment '注文番号',
  orderDate date NOT NULL comment '注文日',
  requiredDate date NOT NULL comment '請求日',
  shippedDate date DEFAULT NULL comment '発送日',
  status varchar(15) NOT NULL comment '受注状況',
  comments text comment 'コメント',
  customerNumber int(11) NOT NULL comment '顧客番号',
  PRIMARY KEY (orderNumber),
  KEY customerNumber (customerNumber)
) ENGINE=InnoDB 
DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci
comment='注文'
;

/*Data for the table orders */
;

/* Table No. 5 */
/*Table structure for table payments */
DROP TABLE IF EXISTS payments;

CREATE TABLE payments (
  customerNumber int(11) NOT NULL comment '顧客番号',
  checkNumber varchar(50) NOT NULL comment '確認番号',
  paymentDate date NOT NULL comment '支払日',
  amount decimal(10,2) NOT NULL comment '金額',
  PRIMARY KEY (customerNumber,checkNumber)
) ENGINE=InnoDB 
DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci
comment='支払'
;

/*Data for the table payments */
;

/* Table No. 6 */
/*Table structure for table productlines */
DROP TABLE IF EXISTS productcategories;

CREATE TABLE productcategories (
  productCategory varchar(50) NOT NULL comment '商品カテゴリ',
  textDescription varchar(4000) DEFAULT NULL comment 'カテゴリ説明',
  htmlDescription mediumtext comment 'HTML説明',
  image mediumblob comment 'イメージ画像',
  PRIMARY KEY (productCategory)
) ENGINE=InnoDB 
DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci
comment='商品カテゴリ'
;

/*Data for the table productlines */
;

/* Table No. 7 */
/*Table structure for table products */
DROP TABLE IF EXISTS products;

CREATE TABLE products (
  productCode varchar(15) NOT NULL comment '商品コード',
  productName varchar(70) NOT NULL comment '商品名',
  productCategory varchar(50) NOT NULL comment '商品カテゴリ',
  productScale varchar(10) NOT NULL comment 'スケール',
  productVendor varchar(50) NOT NULL comment '製造会社',
  productDescription text NOT NULL comment '商品説明',
  quantityInStock smallint(6) NOT NULL comment '在庫数量',
  buyPrice decimal(10,2) NOT NULL comment '売価',
  MSRP decimal(10,2) NOT NULL comment '希望小売価格',
  PRIMARY KEY (productCode),
  KEY productcategories (productCategory)
) ENGINE=InnoDB 
DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci
comment='商品'
;

/*Data for the table products */
;

/* Table No. 8 */
/*Table structure for table customers */
DROP TABLE IF EXISTS customers;

CREATE TABLE customers (
  customerNumber int(11) NOT NULL comment '顧客番号',
  customerName varchar(50) NOT NULL comment '顧客名',
  contactFirstName varchar(50) NOT NULL comment '担当者姓',
  contactLastName varchar(50) NOT NULL comment '担当者名',
  postalCode varchar(15) DEFAULT NULL comment '郵便番号',
  prefecture varchar(50) NOT NULL comment '所在県',
  city varchar(50) NOT NULL comment '所在都市',
  addressLine1 varchar(50) NOT NULL comment '住所1',
  addressLine2 varchar(50) DEFAULT NULL comment '住所2',
  phone varchar(50) NOT NULL comment '電話番号',
  salesRepEmployeeNumber int(11) DEFAULT NULL comment '営業担当従業員番号',
  creditLimit decimal(10,2) DEFAULT NULL comment '売掛金限度額',
  PRIMARY KEY (customerNumber),
  KEY salesRepEmployeeNumber (salesRepEmployeeNumber)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci
comment='顧客'
;

/*Data for the table customers */
;

/* FOREIGN KEYS */
/* For employees */
ALTER TABLE employees ADD CONSTRAINT employees_ibfk_1 FOREIGN KEY (reportsTo) REFERENCES employees(employeeNumber) ON DELETE CASCADE ON UPDATE CASCADE
;
ALTER TABLE employees ADD CONSTRAINT employees_ibfk_2 FOREIGN KEY (officeCode) REFERENCES offices(officeCode) ON DELETE CASCADE ON UPDATE CASCADE
;

/* For orderdetails */
ALTER TABLE orderdetails ADD CONSTRAINT orderdetails_ibfk_1 FOREIGN KEY (orderNumber) REFERENCES orders(orderNumber) 
;
ALTER TABLE orderdetails ADD CONSTRAINT orderdetails_ibfk_2 FOREIGN KEY (productCode) REFERENCES products(productCode) 
;

/* For orders */
ALTER TABLE orders ADD CONSTRAINT orders_ibfk_1 FOREIGN KEY (customerNumber) REFERENCES customers(customerNumber) 
;

/* For payments */
ALTER TABLE payments ADD CONSTRAINT payments_ibfk_1 FOREIGN KEY (customerNumber) REFERENCES customers(customerNumber) 
;

/* For products */
ALTER TABLE products ADD CONSTRAINT products_ibfk_1 FOREIGN KEY (productCategory) REFERENCES productcategories(productCategory) 
;

/* For customers */
ALTER TABLE customers ADD CONSTRAINT customers_ibfk_1 FOREIGN KEY (salesRepEmployeeNumber) REFERENCES employees(employeeNumber) 
;
